INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 2, 24001, 24, 2, "2030/12/17 14:59:59", "アヤネ", 102301, 0.0, 401, 10046, 0.0, "2020/07/31 12:00:00", "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (2.21, 1, 24002, 24, 2, "2030/12/17 14:59:59", "アヤネ", 102301, 0.0, 402, 10046, 0.0, "2020/07/31 12:00:00", "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 2, 24003, 24, 2, "2030/12/17 14:59:59", "アヤネ", 102301, 0.0, 403, 10046, 0.0, "2020/07/31 12:00:00", "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (1.99, 2, 24004, 24, 1, "2030/12/17 14:59:59", "アサヒ", 192201, 0.0, 701, 10046, 0.0, "2020/07/31 12:00:00", "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (2.21, 1, 24005, 24, 2, "2030/12/17 14:59:59", "アサヒ", 192201, 0.0, 702, 10046, 0.0, "2020/07/31 12:00:00", "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (3.33, 2, 24006, 24, 1, "2030/12/17 14:59:59", "アサヒ", 192201, 0.0, 703, 10046, 0.0, "2020/07/31 12:00:00", "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 2, 24007, 24, 2, "2030/12/17 14:59:59", "部員３", 192301, 0.0, 801, 10046, 0.0, "2020/07/31 12:00:00", "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (2.68, 1, 24008, 24, 2, "2030/12/17 14:59:59", "部員３", 192301, 0.0, 802, 10046, 0.0, "2020/07/31 12:00:00", "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 2, 24009, 24, 2, "2030/12/17 14:59:59", "部員３", 192301, 0.0, 803, 10046, 0.0, "2020/07/31 12:00:00", "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 1, 24010, 24, 1, "2030/12/17 14:59:59", "", 192501, 0.0, 501, 10046, 0.0, "2020/07/31 12:00:00", "やった！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 1, 24011, 24, 1, "2030/12/17 14:59:59", "", 192501, 0.0, 502, 10046, 0.0, "2020/07/31 12:00:00", "勝ったよ！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 1, 24012, 24, 1, "2030/12/17 14:59:59", "", 192501, 0.0, 503, 10046, 0.0, "2020/07/31 12:00:00", "いい調子！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (5.33, 6, 24013, 24, 2, "2030/12/17 14:59:59", "ミサト", 113501, 0.0, 111, 10046, 0.0, "2020/07/31 12:00:00", "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (6.85, 1, 24014, 24, 2, "2030/12/17 14:59:59", "ミサト", 113501, 0.0, 112, 10046, 0.0, "2020/07/31 12:00:00", "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (3.0, 1, 24015, 24, 2, "2030/12/17 14:59:59", "ミサト", 113501, 0.0, 113, 10046, 0.0, "2020/07/31 12:00:00", "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (6.11, 1, 24016, 24, 2, "2030/12/17 14:59:59", "ダイチ", 192401, 0.0, 611, 10046, 0.0, "2020/07/31 12:00:00", "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (6.75, 1, 24017, 24, 2, "2030/12/17 14:59:59", "ダイチ", 192401, 0.0, 612, 10046, 0.0, "2020/07/31 12:00:00", "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 2, 24018, 24, 2, "2030/12/17 14:59:59", "ダイチ", 192401, 0.0, 613, 10046, 0.0, "2020/07/31 12:00:00", "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (4.52, 2, 24019, 24, 1, "2030/12/17 14:59:59", "ハツネ", 113401, 0.0, 211, 10046, 0.0, "2020/07/31 12:00:00", "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (3.89, 2, 24020, 24, 1, "2030/12/17 14:59:59", "ハツネ", 113401, 0.0, 212, 10046, 0.0, "2020/07/31 12:00:00", "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (13.49, 1, 24021, 24, 2, "2030/12/17 14:59:59", "ハツネ", 113401, 0.0, 213, 10046, 0.0, "2020/07/31 12:00:00", "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (3.17, 1, 24022, 24, 2, "2030/12/17 14:59:59", "カヤ", 106501, 0.0, 311, 10046, 0.0, "2020/07/31 12:00:00", "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (4.42, 1, 24023, 24, 2, "2030/12/17 14:59:59", "カヤ", 106501, 0.0, 312, 10046, 0.0, "2020/07/31 12:00:00", "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (2.89, 6, 24024, 24, 1, "2030/12/17 14:59:59", "カヤ", 106501, 0.0, 313, 10046, 0.0, "2020/07/31 12:00:00", "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (3.71, 4, 24025, 24, 3, "2030/12/17 14:59:59", "アヤネ", 102301, 0.0, 421, 10046, 0.0, "2020/07/31 12:00:00", "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (5.1, 2, 24026, 24, 1, "2030/12/17 14:59:59", "アサヒ", 192201, 0.0, 721, 10046, 0.0, "2020/07/31 12:00:00", "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (4.34, 1, 24027, 24, 3, "2030/12/17 14:59:59", "部員３", 192301, 0.0, 821, 10046, 0.0, "2020/07/31 12:00:00", "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 1, 24028, 24, 1, "2030/12/17 14:59:59", "", 192501, 0.0, 521, 10046, 0.0, "2020/07/31 12:00:00", "いい勝負だったよ\nまたやろうね");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (5.62, 1, 24029, 24, 2, "2030/12/17 14:59:59", "ミサト", 113501, -360.0, 101, 10046, 0.0, "2020/07/31 12:00:00", "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (9.58, 1, 24030, 24, 2, "2030/12/17 14:59:59", "ミサト", 113501, -360.0, 102, 10046, 0.0, "2020/07/31 12:00:00", "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, 2, 24031, 24, 2, "2030/12/17 14:59:59", "ミサト", 113501, -360.0, 103, 10046, 0.0, "2020/07/31 12:00:00", "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (9.13, 2, 24032, 24, 1, "2030/12/17 14:59:59", "ミサト", 113501, -360.0, 104, 10046, 0.0, "2020/07/31 12:00:00", "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (8.27, 1, 24033, 24, 2, "2030/12/17 14:59:59", "ミサト", 113501, -360.0, 105, 10046, 0.0, "2020/07/31 12:00:00", "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！");
